■ Ha ho lihlahisoa tse sa hulang pampiri, ha ho pampitšana e sa hulang mabokose;
■ Ho jarolla sehlahisoa ho hatelloa ha sehlahisoa se le sieo kapa se sa nepahala, mochini o emisa ka bo ona ha sehlahisoa se kentsoe ka tsela e sa nepahalang ka lebokoseng;
■ Mochini o ikemela ka bo oona ha ho se na mabokose kapa pampiri e sa fumanoeng;
■ Ho bonolo ho fetola lihlahisoa ka litlhaloso tse fapaneng;
■ mosebetsi o moholo oa ts'ireletso bakeng sa polokeho ea mosebelisi
■ Pontšo e iketsang ea lebelo la ho paka le bongata ba palo;
